"use strict";
function noop() { }
exports.LOGGER = {
    log: noop,
    warn: noop,
    error: noop,
    init: initLogger
};
function initLogger() {
    exports.LOGGER.log = console.log.bind(console);
    exports.LOGGER.warn = console.warn.bind(console);
    exports.LOGGER.error = console.error.bind(console);
}
